Хотите сделать приятно любимому человеку или удивить подругу? Портрет в стиле поп-арт - это идеальный и оригинальный подарок для близкого человека.

– Только ручная работа;
– Традиционные технологии поп-арт рисования;
– Рисую на холстах (подрамники);

✔Для создания такого портрета мне от Вас нужна всего лишь фотография!
